import * as React from 'react';

export const Main: React.FC = () => {
  const [temp, setTemp] = React.useState(undefined);
  const weather = () => {
    fetch(
      `https://api.openweathermap.org/data/2.5/weather?zip=94040,us&appid=6cd33f76e223beefab317e542a910250`,
    )
      .then(res => res.json())
      .then(data => setTemp(data.main.temp));
  };
  return (
    <div className="">
      It is working
      <button onClick={weather}>Request</button>
      {temp ? temp : ''}
    </div>
  );
};
